    // AditivoContrato
    ///<summary>
    /// Tabela que armazena informações sobre aditivos contratuais.
    ///</summary>

    public class AditivoContratoDomain
    {

        ///<summary>
        /// Código sequencial que identifica o aditivo contratual.
        ///</summary>
        [Key]
        public int CodigoAditivoContrato { get; set; } // CodigoAditivoContrato (Primary key)
        public string NumeroContratoAditivo { get; set; } // NumeroContratoAditivo (length: 25)

        ///<summary>
        /// Código que identifica o contrato.
        ///</summary>
        public int CodigoContrato { get; set; } // CodigoContrato

        ///<summary>
        /// Indica o tipo de aditivo contratual. Deverá conter um dos seguintes valores:
        /// - PR -&gt; Prazo
        /// - VL -&gt; Valor
        /// - PV -&gt; Prazo e Valor
        ///</summary>
        public string TipoAditivo { get; set; } // TipoAditivo (length: 2)

        ///<summary>
        /// Data em que o aditivo foi incluído no sistema.
        ///</summary>
        public System.DateTime DataInclusao { get; set; } // DataInclusao

        ///<summary>
        /// Código que identifica o usuário responsável pela inclusão do aditivo.
        ///</summary>
        public int CodigoUsuarioInclusao { get; set; } // CodigoUsuarioInclusao

        ///<summary>
        /// Nova data de vigência do contrato (caso ele esteja relacionado a vigência).
        ///</summary>
        public System.DateTime? NovaDataVigencia { get; set; } // NovaDataVigencia

        ///<summary>
        /// Valor adicional aditivado ao contrato. Este valor deverá ser somado ao valor do contrato e aos demais aditivos de valor para compor o total do contrato.
        ///</summary>
        public decimal? NovoValorContrato { get; set; } // NovoValorContrato

        ///<summary>
        /// Data em que o aditivo foi aprovado.
        ///</summary>
        public System.DateTime? DataAprovacaoAditivo { get; set; } // DataAprovacaoAditivo

        ///<summary>
        /// Código que identifica o usuário responsável pela aprovação do aditivo.
        ///</summary>
        public int? CodigoUsuarioAprovacao { get; set; } // CodigoUsuarioAprovacao

        ///<summary>
        /// Descrição do motivo da aditivação do contrato.
        ///</summary>
        public string DescricaoMotivoAditivo { get; set; } // DescricaoMotivoAditivo (length: 2000)

        ///<summary>
        /// Data em que o aditivo foi logicamente excluído.
        ///</summary>
        public System.DateTime? DataExclusao { get; set; } // DataExclusao

        ///<summary>
        /// Código que identifica o usuário responsável pela exclusão do aditivo.
        ///</summary>
        public int? CodigoUsuarioExclusao { get; set; } // CodigoUsuarioExclusao

        ///<summary>
        /// Identifica o tipo de contrato de aditivo está sendo firmado. Na Norte Energia há dois tipos possíveis, sendo um &quot;Aditivo&quot; normal e outro denominado &quot;TEC&quot; que também poderia ser utilizado.
        ///</summary>
        public short CodigoTipoContratoAditivo { get; set; } // CodigoTipoContratoAditivo
        public int? CodigoWorkflow { get; set; } // CodigoWorkflow
        public long? CodigoInstanciaWf { get; set; } // CodigoInstanciaWF
        public decimal? ValorContrato { get; set; } // ValorContrato
        public decimal? ValorAditivo { get; set; } // ValorAditivo

        // Foreign keys

        /// <summary>
        /// Parent Contrato pointed by [AditivoContrato].([CodigoContrato]) (FK_AditivoContrato_Contrato)
        /// </summary>
        public virtual ContratoDomain Contrato { get; set; } // FK_AditivoContrato_Contrato

        /// <summary>
        /// Parent InstanciasWorkflow pointed by [AditivoContrato].([CodigoWorkflow], [CodigoInstanciaWf]) (FK_Aditivo_InstanciasWF)
        /// </summary>
        public virtual InstanciasWorkflowDomain InstanciasWorkflow { get; set; } // FK_Aditivo_InstanciasWF

        public AditivoContratoDomain()
        {
            TipoAditivo = "PR";
        }
    }

