    // CV_Versionamento
    ///<summary>
    /// Armazena os dados para versionamento
    /// Enquanto uma versão está em desenvolvimento ou, como se diz, está instável, deve­se utilizar
    /// uma versão de segundo nível de número ímpar, por exemplo: v1_1, v1_3. Quando a versão se
    /// tornar estável, deve ser promovida para o número par seguinte, por exemplo: se a versão
    /// instável era a v1_1, a versão estável deve ser a v1_2. Assim, em produção só poderemos ter
    /// versões de segundo nível com números pares.
    /// Cada versão deve começar com a letra “v” minúscula, seguido da versão principal, por
    /// exemplo: v1, v2.
    /// • Como separador para o segundo e terceiro nível da versão deve­se utilizar o “_”, por
    /// exemplo: v1_0, v1_0_1, v1_2, v0_5, etc.
    /// • O nível principal e o segundo são obrigatórios, o terceiro somente se houver
    ///</summary>

    public class CvVersionamentoDomain
    {

        ///<summary>
        /// Chave Primaria da tabela
        ///</summary>
        [Key]
        public int CodigoVersionamento { get; set; } // CodigoVersionamento (Primary key)

        ///<summary>
        /// Prefixo para controle de versao
        ///</summary>
        public string PrefixoVersao { get; set; } // PrefixoVersao (length: 6)

        ///<summary>
        /// defini as versões principais do projeto 1, 2, 3...
        ///</summary>
        public short NumVersionamentoPrincipal { get; set; } // NumVersionamentoPrincipal

        ///<summary>
        /// Deve­se incrementar as versões de segundo nível (v1_0, v1_1,...) quando algum requisito foi
        /// alterado ou incluído na versão principal.
        ///</summary>
        public short NumVersionamentoSegundoNivel { get; set; } // NumVersionamentoSegundoNivel

        ///<summary>
        /// O terceiro nível de versionamento (v1_0_1, v1_2_1,...) deve ser utilizado quando a versão de
        /// segundo nível foi corrigida devido a algum “bug” encontrado depois da sua disponibilização.
        ///</summary>
        public short? NumVersionamentoTerceiroNivel { get; set; } // NumVersionamentoTerceiroNivel

        ///<summary>
        /// Data da geração da versão
        ///</summary>
        public System.DateTime DataVersionamento { get; set; } // DataVersionamento

        ///<summary>
        /// Usuário responsável pelo versionamento
        ///</summary>
        public int CodigoUsuarioResponsavel { get; set; } // CodigoUsuarioResponsavel

        // Reverse navigation

        /// <summary>
