        /// </summary>
        public List<CvDocumentosGeradoDomain> ListCvDocumentosGerado { get; set; } // CV_DocumentosGerados.FK_CV_DocumentosGerados_CV_Versionamento

        public CvVersionamentoDomain()
        {
            ListCvDocumentosGerado = new System.Collections.Generic.List<CvDocumentosGeradoDomain>();
        }
    }

