        ///<summary>
        /// Permite identificar a probabilidade/prioridade do risco/questao. Deverá conter um dos seguintes valores:
        /// 1 - Baixa
        /// 2 - Média
        /// 3 - Alta
        ///</summary>
        public short? ProbabilidadePrioridade { get; set; } // ProbabilidadePrioridade

        ///<summary>
        /// Permite identificar o impacto/urgência do risco/questão. Deverá conter um dos seguintes valores:
        /// 1 - Baixo/baixa
        /// 2 - Médio/média
        /// 3 - Alto/alta
        ///</summary>
        public short? ImpactoUrgencia { get; set; } // ImpactoUrgencia

        ///<summary>
        /// Código que identifica o tipo de risco/issue. Os tipos de risco se limitam a &quot;Positivo&quot; e &quot;Negativo&quot;. Já as questões podem assumir vários tipos definidos pelo usuário.
        ///</summary>
        public short CodigoTipoRiscoQuestao { get; set; } // CodigoTipoRiscoQuestao

        ///<summary>
        /// Código que identifica a pessoa responsável pelo risco/questão.
        ///</summary>
        public int CodigoUsuarioResponsavel { get; set; } // CodigoUsuarioResponsavel

