    // SolicitacaoRecalculoIndicador
    ///<summary>
    /// Tabela para registrar as solicitações de recálculo de indicadores. Os registros desta tabela são inseridos nas alterações de informações que demandem recálculos (fórmula do indicador, alterações de metas, etc) e tratados durante o processo de recálculo do indicador. Os registros desta tabela são excluídos tão logo tenham sido tratados.
    ///</summary>

    public class SolicitacaoRecalculoIndicadorDomain
    {

        ///<summary>
        /// Código identificador da solicitação de recálculo, gerado automaticamente a cada inclusão.
        ///</summary>
        [Key]
        public int CodigoSolicitacao { get; set; } // CodigoSolicitacao (Primary key)

        ///<summary>
        /// Tipo de informação a calcular &apos;R&apos;esultado ou &apos;M&apos;eta.
        ///</summary>
        public string TipoInformacaoCalculo { get; set; } // TipoInformacaoCalculo (length: 1)

        ///<summary>
        /// Abreviação do escopo de indicadores a serem calculados. Dois os valores possíveis:
        /// 1. &apos;IEQ&apos; =&gt; Indica que o cálculo será apenas para o indicador em questão cujo código estará na coluna [CodigoObjetoEscopo].
        /// 2. &apos;TIA&apos; =&gt; Todos os Indicadores Afetados. Este valor é usado na alteração de alguma informação de um dado, indicando então que todos os indicadores que dependem do dado alterado devem ser recalculados. O código do dado alterado estará na coluna [CodigoObjetoEscopo].
        ///</summary>
        public string EscopoIndicadorCalculo { get; set; } // EscopoIndicadorCalculo (length: 3)

        ///<summary>
        /// Esta coluna irá conter o código do Indicador ou do Dado conforme o que estiver contido na coluna EscopoIndicadorCalculo.
        ///</summary>
        public int CodigoObjetoEscopo { get; set; } // CodigoObjetoEscopo

        ///<summary>
        /// Esta coluna conterá uma abreviação do escopo de unidades para as quais são necessários os cálculos. Os valores possíveis são:
        /// 1. &apos;TUC&apos; =&gt; Indica que o cálculo deve ser feito para todas as unidades em que o(s) indicador(es) estiver(em) compartilhado(s). Nesse caso, o parâmetro a coluna [CodigoUnidadeReferencia] não conterá valor algum (NULL).
        /// 2. &apos;TUS&apos; =&gt; O cálculo deve ser feito para as unidades superiores à unidade em questão. O código da unidade em questão estará na coluna [CodigoUnidadeReferencia].
        /// 3. &apos;UEQeTUS&apos; =&gt; O cálculo deve ser feito para a unidade em questão e para todas as unidades superiores a ela. O código da unidade em questão estará na coluna [CodigoUnidadeReferencia].
        ///</summary>
        public string EscopoUnidadeCalculo { get; set; } // EscopoUnidadeCalculo (length: 7)

        ///<summary>
        /// Esta coluna conterá o valor NULL ou o código da unidade de referência, conforme o valor contido na coluna [EscopoUnidadeCalculo].
        ///</summary>
        public int? CodigoUnidadeReferencia { get; set; } // CodigoUnidadeReferencia

        ///<summary>
        /// Coluna para conter uma abreviação do escopo de período para os quais são necessários os cálculos. Os valores possíveis são:
        /// 1. &apos;TP&apos; =&gt; Indica que o cálculo deve ser feito para todo o período em que constar informação para o indicador (metas e resultados). 
        /// 2. &apos;PA&apos; =&gt; O cálculo deve ser feito apenas para o período alterado. Nesse caso, o período alterado estará registrado nas colunas [Ano] e [Mes].
        ///</summary>
        public string EscopoPeriodoCalculo { get; set; } // EscopoPeriodoCalculo (length: 2)

        ///<summary>
        /// Coluna para conter o Ano, necessária para interpretação do valor da coluna [EscopoPeriodoCalculo]. Poderá conter NULL nas situações mencionadas na anotação desta coluna.
        ///</summary>
        public short? Ano { get; set; } // Ano

        ///<summary>
        /// Coluna para conter o Ano, necessária para interpretação do valor da coluna [EscopoPeriodoCalculo]. Poderá conter NULL nas situações mencionadas na anotação desta coluna.
        ///</summary>
        public short? Mes { get; set; } // Mes

        ///<summary>
        /// Conterá o momento (dia/hh/min/seg/mseg) da solicitação do recálculo.
        ///</summary>
        public System.DateTime DataSolicitacao { get; set; } // DataSolicitacao

        ///<summary>
        /// Indica se a solicitação já foi ou não detalhada (S ou N). Quando uma solicitação é detalhada, são gerados os registros em detalhes na tabela [ControleCalculoIndicador].
        ///</summary>
        public string IndicaSolicitacaoDetalhada { get; set; } // IndicaSolicitacaoDetalhada (length: 1)
    }

